import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import ChatRoom from "./pages/ChatRoom"

function App() {
  return (
    <Router>
            <Routes>
                <Route exact path="/" element={<ChatRoom />} />
            </Routes>
        </Router>
  );
}
